	/**
	 * Devuelve la fecha (la primera si 'parar' el true y la ultima si 'parar' es
	 * false) del historico de estados de la poliza correspondiente al estado
	 * indicado en el parametro
	 * 
	 * @param estado
	 * @param parar
	 * @return
	 */
	private Date getFechaEstado(BigDecimal estado, boolean parar) {
		Set<HistoricoEstados> histEstados = this.getHistoricoEstados();
		Date fecha = null;

		if (histEstados != null) {

			for (HistoricoEstados he : histEstados) {
				if (estado.equals(he.getEstado())) {
					fecha = he.getFecha();
					if (parar)
						break;
				}
			}

		}

		return fecha;
	}

	/**
	 * Devuelve el codigo de usuario (la primera si 'parar' el true y la ultima
	 * si 'parar' es false) del historico de estados de la poliza
	 * correspondiente al estado indicado en el parametro
	 * 
	 * @param estado
	 * @param parar
	 * @return
	 */
	private String getUsuarioEstado(BigDecimal estado, boolean parar) {
		Set<HistoricoEstados> histEstados = this.getHistoricoEstados();
		String usuarioStr = null;

		if (histEstados != null) {

			for (HistoricoEstados he : histEstados) {
				if (estado.equals(he.getEstado())) {
					usuarioStr = he.getCodusuario();
					if (parar)
						break;
				}
			}

		}
		return usuarioStr;
	}

