	public List<Long> getCodigosTipoAnimalExplotaciones() {
		List<Long> res = null;
		if (this.getExplotacions() != null && this.getExplotacions().size() > 0) {
			for (Explotacion exp : this.getExplotacions()) {
				if (exp.getGrupoRazas() != null && exp.getGrupoRazas().size() > 0) {
					for (GrupoRaza gr : exp.getGrupoRazas()) {
						if (gr.getCodtipoanimal() != null) {
							if (res == null)
								res = new ArrayList<Long>();
							if (!res.contains(gr.getCodtipoanimal()))
								res.add(gr.getCodtipoanimal());
						}
					}
				}
			}

		}
		return res;
	}

